import React from 'react';
import './App.css';

function App() {
  return (
    <div style={style.wrapper}>
      <header style={style.headerStyle}>
        <label style={style.appTitle}>VIMATION</label>
      </header>
      <div id="project-name">

      </div>

    </div>
  );
}

export default App;


const style = {
  wrapper : {
    backgroundColor : '#101010',
    color: 'white',
    height: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  appTitle : {
    fontSize : '2.2em',
    color : 'white',
    marginLeft: '3.2em',
    fontWeight : 'bold'
  },
  headerStyle : {
    display: 'flex',

    width : "100%",
    padding : '1.4em',
    flexDirection: 'row',
    alignItems : 'space-between'
  }
}
